                <h1>Bienvenue chez Solidarité Aulnay</h1>
                <h2>Ici, vous pouvez proposer de l'aide à nos utilisateurs et en demander également, vous pouvez retrouver nos différentes annonces en cliquant <Link to="/annonces">ici</Link>ici
                </h2>
            </div>

        </div>
    )
}
